var failed: ?Exception = None
public class Subscriber {
    private var prio: Int64
    private var cancel: Bool
    public Subscriber(prio: Int64, cancel: Bool) {
        this.prio = prio
        this.cancel = cancel
    }
    @Subscribe
    public func onEvent(event: String) {
        countMyEvent1++
        handleEvent(event, 0);
    }
    @Subscribe[priority: 1]
    public func onEvent1(event: String) {
        countMyEvent1++
        handleEvent(event, 1);
    }
    @Subscribe[priority: 2]
    public func onEvent2(event: String) {
        countMyEvent1++
        handleEvent(event, 2);
    }
    @Subscribe[priority: 3]
    public func onEvent3(event: String) {
        countMyEvent1++
        handleEvent(event, 3);
    }
    private func handleEvent(event: String, prio: Int64) {
        if (this.prio == prio) {
            if (cancel) {
                eventBus.cancelEventDelivery(event);
            }
        }
    }
}
