    private static func parse(runes: Array<Rune>): S3XmlElement_Runes {
        var root = S3XmlElement_Runes()
        var current = root
        var flag = 0
        var textBegin = 0
        var attrName = ""
        var attrValue = ""
        var quotes = 0
