        let len = runes.size
        while (pos < len) {
            let rune = runes[pos]
            pos++
            match (rune) {
                case '<' => if (runes[pos] != r'/') {
                    let child = S3XmlElement_Runes()
                    current.addChild(child)
                    current = child
                    flag = 1
                    textBegin = pos
