                    current.content = String(runes.slice(textBegin, pos - 1 - textBegin))
                    current = current.parent.getOrThrow()
                    flag = 0
                }
                case ' ' => if (flag == 1) {
                    current.name = String(runes.slice(textBegin, pos - 2 - textBegin))
                    textBegin = pos
                    flag = 2
                }
                case '=' => if (flag == 2) {
                    if (quotes == 0) {
                        let next = runes[pos]
                        if (next == r'\'') {
                            quotes = 1
                            attrName = String(runes.slice(textBegin, pos - 1 - textBegin))
                            textBegin = pos
                            pos++
                        } else if (next == r'"') {
                            quotes = 2
                            attrName = String(runes.slice(textBegin, pos - 1 - textBegin))
                            textBegin = pos
                            pos++
                        }
                    }
                }
                case '\'' => if (quotes == 1) {
                    attrValue = String(runes.slice(textBegin, pos - textBegin))
                    textBegin = pos
                    current.attrMap.put(attrName, attrValue)
                }
                case '"' => if (quotes == 2) {
                    attrValue = String(runes.slice(textBegin, pos - textBegin))
                    textBegin = pos
                    current.attrMap.put(attrName, attrValue)
                }
                case '/' => if (runes[pos] == r'>') {
                    if (current.name == "") {
                        current.name = String(runes.slice(textBegin, pos - 2 - textBegin))
                    }
                    current = current.parent.getOrThrow()
                    flag = 0
                    textBegin = pos
                }
                case '>' =>
                    if (flag == 1) {
                        current.name = String(runes.slice(textBegin, pos - 1 - textBegin))
                    }
                    textBegin = pos
                    flag = 4
                case _ => ()
