class S3XmlElement_Bytes <: ToString {
    public var name: String = ""
    public var content: String = ""
    private let attrMap = HashMap<String, String>()
    private let childs = ArrayList<S3XmlElement_Bytes>()
    private var parent: ?S3XmlElement_Bytes = None
    public static func fromXml(xml: String): S3XmlElement_Bytes {
        let bytes = xml.toArray()
        return parse(bytes)
    }
    private static func parse(bytes: Array<Byte>): S3XmlElement_Bytes {
        var root = S3XmlElement_Bytes()
        var current = root
        var flag = 0
        var textBegin = 0
        var attrName = ""
        var attrValue = ""
        var quotes = 0
        var pos = 0
        let len = bytes.size
        while (pos < len) {
            let rune = bytes[pos]
            pos++
            match (rune) {
                case b'<' => if (bytes[pos] != b'/') {
                    let child = S3XmlElement_Bytes()
                    current.addChild(child)
                    current = child
                    flag = 1
                    textBegin = pos
                } else {
                    current.content = String.fromUtf8(bytes.slice(textBegin, pos - 1 - textBegin))
                    current = current.parent.getOrThrow()
                    flag = 0
                }
                case b' ' => if (flag == 1) {
                    current.name = String.fromUtf8(bytes.slice(textBegin, pos - 2 - textBegin))
                    textBegin = pos
                    flag = 2
                }
                case b'=' => if (flag == 2) {
                    if (quotes == 0) {
                        let next = bytes[pos]
                        if (next == b'\'') {
                            quotes = 1
                            attrName = String.fromUtf8(bytes.slice(textBegin, pos - 1 - textBegin))
                            textBegin = pos
                            pos++
                        } else if (next == b'"') {
                            quotes = 2
                            attrName = String.fromUtf8(bytes.slice(textBegin, pos - 1 - textBegin))
                            textBegin = pos
                            pos++
                        }
                    }
                }
                case b'\'' => if (quotes == 1) {
                    attrValue = String.fromUtf8(bytes.slice(textBegin, pos - textBegin))
                    textBegin = pos
                    current.attrMap.put(attrName, attrValue)
                }
                case b'"' => if (quotes == 2) {
                    attrValue = String.fromUtf8(bytes.slice(textBegin, pos - textBegin))
                    textBegin = pos
                    current.attrMap.put(attrName, attrValue)
                }
                case b'/' => if (bytes[pos] == b'>') {
                    if (current.name == "") {
                        current.name = String.fromUtf8(bytes.slice(textBegin, pos - 2 - textBegin))
                    }
                    current = current.parent.getOrThrow()
                    flag = 0
                    textBegin = pos
                }
                case b'>' =>
                    if (flag == 1) {
                        current.name = String.fromUtf8(bytes.slice(textBegin, pos - 1 - textBegin))
                    }
                    textBegin = pos
                    flag = 4
                case _ => ()
            }
