main() {
    let path: String = getcwd()
    let fileStream = File("${path}/region_info.csv", OpenOption.Open(true, false))
    let recordList = ArrayList<CSVRecord>()
    if (fileStream.canRead()) {
        let stream = UTF8ReaderStream(fileStream)
        let reader = CSVReader(stream)
        let format: CSVParseFormat = CSVParseFormat.DEFAULT.setFirstLineAsHeader(true)
        let csvParser = CSVParser(reader, format)
        var count = 0
        let startTime = DateTime.now()
        for (csvRecord in csvParser) {
            recordList.append(csvRecord)
            count++
        }
        let stopTime = DateTime.now()
        let usedTime = stopTime - startTime
        println("一共解析了${count}条记录，使用了${usedTime}时间")
        fileStream.close()
    }
    printCsv(recordList)
    printCsvWithCache(recordList)
}
func printCsv(recordList: ArrayList<CSVRecord>) {
    let path: String = getcwd()
    let fileStream = File("${path}/temp.csv", OpenOption.CreateOrTruncate(true))
    let outFormat = CSVOutFormat.DEFAULT
    let csvPrint = CSVPrinter(outFormat)
    if (fileStream.canWrite()) {
        let startTime = DateTime.now()
        var firstLine = true
        for (record in recordList) {
            if (firstLine) {
                csvPrint.print(record, fileStream)
                firstLine = false
            } else {
                csvPrint.printLine(fileStream)
                csvPrint.print(record, fileStream)
            }
        }
        fileStream.flush()
        fileStream.close()
        let stopTime = DateTime.now()
        let usedTime = stopTime - startTime
        println("一共写入了${recordList.size}条记录，使用了${usedTime}时间")
    }
}
func printCsvWithCache(recordList: ArrayList<CSVRecord>) {
    let path: String = getcwd()
    let fileStream = File("${path}/temp2.csv", OpenOption.CreateOrTruncate(true))
    let sw = CacheWriter(fileStream)
    let outFormat = CSVOutFormat.DEFAULT
    let csvPrint = CSVPrinter(outFormat)
    let startTime = DateTime.now()
    var firstLine = true
    for (record in recordList) {
        if (firstLine) {
            csvPrint.print(record, sw)
            firstLine = false
        } else {
            csvPrint.printLine(sw)
            csvPrint.print(record, sw)
        }
    }
    sw.flush()
    fileStream.close()
    let stopTime = DateTime.now()
    let usedTime = stopTime - startTime
    println("一共写入了${recordList.size}条记录，使用了${usedTime}时间")
}
class CacheWriter <: Appendable {
    let sw: StringWriter<File>
    public init(file: File) {
        sw = StringWriter(file)
    }
    public func append(str: String) {
        if (!str.isEmpty()) {
            sw.write(str)
        }
    }
    public func append(str: Array<Rune>) {
        append(String(str))
    }
    public func append(chr: Rune) {
        sw.write(chr)
    }
    public func flush() {
        sw.flush()
    }
}

