func isReadLineMatch(content: String, matchValue: String): Bool {
    var readerStream = StringStream(content)
    var reader = CSVReader(readerStream)
    var line = reader.readLine()
    if (let Some(value) <- line) {
        return value == matchValue
    }
    return false
}

