"""
    let map = readFileToMap(encodeName)
    var decodeMappingStr = "let " + encodeName.replace("-", "_") + "Mapping: Array<Array<UInt32>> = [\n"
    let list = ArrayList<UInt32>()
    for ((k, _) in map) {
