    list.sortBy(stable: false, comparator: compareTo)
    for (v in 0..list.size) {
        var i = list[v]
        if (map.contains(UInt32(i))) {
            var codePoint = map[UInt32(i)]
            decodeMappingStr = decodeMappingStr + "\t\t[${i}, 0x" + codePoint.format("04x") + "]"
        } else {
