            if (res.getOrThrow() != "Thread2-Value${i}") {
                throw RedisException("${Thread.currentThread.name} expected Thread2-Value${i} but ${res}")
            }
        }
        println("${Thread.currentThread.name} Success")
    }
    fut2.thread.name = "Thread2"
    barrier.wait()
    for (i in 0..maxLoopCount) {
        println("${Thread.currentThread.name} : SET ${mainThreadKey}${i} MainThread-Value${i}")
        redisClient.set("${mainThreadKey}${i}", "MainThread-Value${i}")
        let res = redisClient.get("${mainThreadKey}${i}")
        println("${Thread.currentThread.name} : GET ${mainThreadKey}${i} = ${res}")
        if (res.getOrThrow() != "MainThread-Value${i}") {
            throw RedisException("${Thread.currentThread.name} expected MainThread-Value${i} but ${res}")
        }
    }
    fut1.get()
    fut2.get()
