    let addTask = AtomicBool(true)
    spawn {
        var id = 0;
        while (addTask.load()) {
            id++
            threadpool.addTask(SimpleTask(id))
        }
    }
    sleep(10 * Duration.second)
    println("===================Stop add task===================")
    addTask.store(false)
    println("===================Sleep 10 seconds: ===================")
    sleep(10 * Duration.second)
    println("===================Sleep 10 seconds ends===================")
    println("===================threadpool.stop()===================")
    threadpool.stop()
}
