    private let id: Int64
    private static let mutex = ReentrantMutex()
    public init(id: Int64) {
        this.id = id
    }
    public func run() {
        synchronized(mutex) {
            println("${Thread.currentThread.name} running SimpleTask${id}")
        }
        sleep(100 * Duration.millisecond)
    }
}

