class S3XmlElement_String <: ToString {
    public var name: String = ""
    public var content: String = ""
    private let attrMap = HashMap<String, String>()
    private let childs = ArrayList<S3XmlElement_String>()
    private var parent: ?S3XmlElement_String = None
    public static func fromXml(xml: String): S3XmlElement_String {
        return parse(xml)
    }
    private static func parse(xml: String): S3XmlElement_String {
        var root = S3XmlElement_String()
        var current = root
        var flag = 0
        var textBegin = 0
        var attrName = ""
        var attrValue = ""
        var quotes = 0
        var pos = 0
        let len = xml.size
        while (pos < len) {
            let rune = xml[pos]
            pos++
            match (rune) {
                case b'<' => if (xml[pos] != b'/') {
                    let child = S3XmlElement_String()
                    current.addChild(child)
                    current = child
                    flag = 1
                    textBegin = pos
                } else {
                    current.content = xml[textBegin..pos - 1]
                    current = current.parent.getOrThrow()
                    flag = 0
                }
                case b' ' => if (flag == 1) {
                    current.name = xml[textBegin..pos - 2]
                    textBegin = pos
                    flag = 2
                }
                case b'=' => if (flag == 2) {
                    if (quotes == 0) {
                        let next = xml[pos]
                        if (next == b'\'') {
                            quotes = 1
                            attrName = xml[textBegin..pos - 1]
                            textBegin = pos
                            pos++
                        } else if (next == b'"') {
                            quotes = 2
                            attrName = xml[textBegin..pos - 1]
                            textBegin = pos
                            pos++
                        }
                    }
                }
                case b'\'' => if (quotes == 1) {
                    attrValue = xml[textBegin..pos]
                    textBegin = pos
                    current.attrMap.put(attrName, attrValue)
                }
                case b'"' => if (quotes == 2) {
                    attrValue = xml[textBegin..pos]
                    textBegin = pos
                    current.attrMap.put(attrName, attrValue)
                }
                case b'/' => if (xml[pos] == b'>') {
                    if (current.name == "") {
                        current.name = xml[textBegin..pos - 2]
                    }
                    current = current.parent.getOrThrow()
                    flag = 0
                    textBegin = pos
                }
                case b'>' =>
                    if (flag == 1) {
                        current.name = xml[textBegin..pos - 1]
                    }
                    textBegin = pos
                    flag = 4
                case _ => ()
            }
        }
        return root.childs[0]
    }
    init() {
    }
    private func addChild(child: S3XmlElement_String): Unit {
        childs.append(child)
        child.parent = this
    }
    public func toString(): String {
        let childsXml = childs |> map<S3XmlElement_String, String> {child => child.toString()} |> collectString<String>()
        let attrsXml = attrMap |> map<(String, String), String> {kv => kv[0] + "=" + kv[1]} |> collectString<(String)>(
            delimiter: " ")
        if (attrsXml != "") {
            return "<${name} ${attrsXml}>${content}${childsXml}</${name}>"
        } else {
            return "<${name}>${content}${childsXml}</${name}>"
        }
    }
}
