    var encodeRes = aesEncode(inside, keys,ivec)
    println(toBase64String(encodeRes))
    if(toBase64String(encodeRes) != "PnOERWwc1DLUmgYVxKo7OXVpuTRSL9MfPQwQWrpmYNw=") {
        return -1
    }
    ivec = "0000000000000000".toArray()
    var decodeRes = aesDecode(encodeRes, keys, ivec)
    println(String.fromUtf8(decodeRes))
    if(!String.fromUtf8(decodeRes).contains("skfhafahglkahglahglkahgalgfssffe")) {
        return -1
    }
    return 0
