func aesEncode(inside: Array<UInt8>, keys: Array<UInt8>, ivec: Array<UInt8>): Array<UInt8> {
    var key = AESKEY()
    var outside: Array<UInt8> = Array<UInt8>(Int64(AES_BLOCK_SIZE), repeat: 0)
    aesSetEncryptKey(keys, 128, key)
    var data: ArrayList<Array<UInt8>> = arrayTo2Array(inside, Int64(AES_BLOCK_SIZE))
    var res: ArrayList<UInt8> = ArrayList<UInt8>()
    for( i in 0..data.size ) {
        aesCbcEncrypt(data[i], outside, key, ivec, AES_ENCRYPT)
        res.appendAll(outside)
    }
    return res.toArray()
}
func aesDecode(inside: Array<UInt8>, keys: Array<UInt8>, ivec: Array<UInt8>): Array<UInt8> {
    var key = AESKEY()
    var outside: Array<UInt8> = Array<UInt8>(Int64(AES_BLOCK_SIZE), repeat: 0)
    aesSetDecryptKey(keys, 128, key)
    var data: ArrayList<Array<UInt8>> = arrayTo2Array(inside, Int64(AES_BLOCK_SIZE))
    var res: ArrayList<UInt8> = ArrayList<UInt8>()
    for( i in 0..data.size ) {
        aesCbcEncrypt(data[i], outside, key, ivec, AES_DECRYPT)
        res.appendAll(outside)
    }
    return res.toArray()
}

