func aesEncode(inside: Array<UInt8>, keys: Array<UInt8>, ivec: Array<UInt8>): Array<UInt8> {
    var key = AESKEY()
    var outside: Array<UInt8> = Array<UInt8>(Int64(inside.size), repeat: 0)
    aesSetEncryptKey(keys, 128, key)
    aesCfb128Encrypt(inside, outside, key, ivec, AES_ENCRYPT)
    return outside
}
func aesDecode(inside: Array<UInt8>, keys: Array<UInt8>, ivec: Array<UInt8>): Array<UInt8> {
    var key = AESKEY()
    var outside: Array<UInt8> = Array<UInt8>(Int64(inside.size), repeat: 0)
    aesSetEncryptKey(keys, 128, key)
    aesCfb128Encrypt(inside, outside, key, ivec, AES_DECRYPT)
    return outside
}

